/*Table structure for table `tbl_customertype` */

DROP TABLE IF EXISTS `tbl_customertype`;

CREATE TABLE `tbl_customertype` (
  `customertype_id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(50) CHARACTER SET latin1 NOT NULL,
  PRIMARY KEY (`customertype_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

/*Data for the table `tbl_customertype` */

insert  into `tbl_customertype`(`customertype_id`,`type`) values (1,'SETUP CORE'),(2,'NON SETUP'),(3,'SETUP NON-CORE');

/*Table structure for table `tbl_generatedcustomercode` */

DROP TABLE IF EXISTS `tbl_generatedcustomercode`;

CREATE TABLE `tbl_generatedcustomercode` (
  `GeneratedCustomerID` int(11) NOT NULL AUTO_INCREMENT,
  `Agency_id` int(11) DEFAULT NULL,
  `IncrementCustomerCode` int(11) DEFAULT NULL COMMENT 'this will be the basis of customer code increment',
  PRIMARY KEY (`GeneratedCustomerID`),
  UNIQUE KEY `Agency_id` (`Agency_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

/*Data for the table `tbl_generatedcustomercode` */

insert  into `tbl_generatedcustomercode`(`GeneratedCustomerID`,`Agency_id`,`IncrementCustomerCode`) values (1,11,NULL);

